import { makeStyles } from "@mui/styles";

const RegisterStyle = makeStyles({
    Box : {
        margin: "0",
        padding: "0",
        height: "600px",
        width: "350px",

        display: "flex",
        flexDirection: "column",
        // justifyContent: "center",
        // alignItems: "center",
        gap: "1.5rem",

        border: "solid",
        borderRadius: "30px",
        userSelect: "none",
    }
})

export default RegisterStyle
